import React from 'react';

const SeamlessConnectivity = () => {
    return(
        <div className='container min-h-screen Seam'>
            <div className='text-center'>
                <h2>Seamless Connectivity</h2>
                <p>A strategic location where everything is within your reach. </p>
            </div>
        </div>
    )
}
export default SeamlessConnectivity;
